import './Search.css';

function SearchPage() {
  return (
    <div className="Search-Page">
      <header className="Search-header">
        <title>DicomWebViewer</title>
        <h1>DicomWebViewer App</h1>    
      </header>
    </div>    
  );
}

function SearchBody() {
    return (
      <div className="Search-Body">
        <body className="Search-content">
          <input type="checkbox" value="Orthanc Server"></input>
        </body>
      </div>
    );
  }


export default {SearchPage, SearchBody};
